package com.baidu.web.vo.paypal;import com.fasterxml.jackson.annotation.JsonProperty;import lombok.Data;/** * @author xzll * @date 2021/10/8 20:21 * @description */@Datapublic class PaymentPreferences {    /**     * 指示是否在下一个计费周期中自动计费未清金额。     */    @JsonProperty("auto_bill_outstanding")    private Boolean autoBillOutstanding;    /**     * 服务的初始设置费。     */    @JsonProperty("setup_fee")    private SetupFee setupFee;    /**     *设置费用失败行动     * 如果安装的初始付款失败，对订阅采取的操作。     * CONTINUE 如果安装的初始付款失败，则继续订阅     * CANCEL 如果初始安装付款失败，则取消订阅     */    @JsonProperty("setup_fee_failure_action")    private String setupFeeFailureAction;    /**     * 支付失败重试阈值 最大值999     */    @JsonProperty("payment_failure_threshold")    private Integer paymentFailureThreshold;}